from numpy.polynomial.legendre import leggauss
from numpy                     import array

points_cartesiens = array ; poids = array                                     # définition de types : informatif
def quadlaum(order: int = 1, typeelem: str = 'Ka') -> [points_cartesiens, poids] :
    if typeelem == 'Ka':
        return leggauss(order)

    elif typeelem == 'Kt':
        points = eval("points_dunavant_{:02d}".format(order))                 # sélection du schéma
        _points_Kt = (points.T).dot(array([[-1, -1], [1, -1], [-1, 1]]))      # passage en coordonnées cartésiennes pour Kt
        weights = eval("weights_dunavant_{:02d}".format(order))               # sélection du schéma
        return _points_Kt[:, 0], _points_Kt[:,1], 2*weights
    
    else:                                                                     # TODO
        print("quadlaum > ERREUR : type d'élément inconnu :", typeelem)


